		"diploma/admin/organization/view/DetailFormChange.fragment.xml": "<core:FragmentDefinition \n    xmlns:core=\"sap.ui.core\" \n    xmlns:form=\"sap.ui.layout.form\"\n    xmlns=\"sap.m\">\n\t<form:SimpleForm layout=\"ResponsiveGridLayout\" \n\t\tmaxContainerCols=\"2\" \n\t\teditable=\"true\" class=\"editableForm\"\n\t\tlabelSpanL=\"3\"  labelSpanM=\"3\" \n\t\temptySpanL=\"2\"  emptySpanM=\"2\" \n\t\tcolumnsL=\"1\"    columnsM=\"1\"\n\t\tvisible=\"{global>/edit}\">\n\t    <form:toolbar>\n\t        <Toolbar>\n\t            <Title text=\"{i18n>detailIconTabBarInfo}\" />\n\t            <ToolbarSpacer />\n    \t\t\t<Button visible=\"{= !${global>/isNew} }\" \n    \t\t\t    icon=\"sap-icon://undo\" \n    \t\t\t    tooltip=\"{i18n>undoButtonTooltip}\" \n    \t\t\t    press=\"onUndo\" />\n    \t\t\t<Button visible=\"{= !${global>/isNew} }\" \n    \t\t\t    icon=\"sap-icon://save\" \n    \t\t\t    tooltip=\"{i18n>saveButtonTooltip}\" \n    \t\t\t    press=\"onUpdateCommit\" />\n\t        </Toolbar>\n\t    </form:toolbar>\n\t    \n\t    <Label text=\"{i18n>deviceName}\"/>\n\t\t<Input id=\"deviceName\" value=\"{name}\" width=\"100%\"/>\n\t\t<Label text=\"{i18n>deviceDesc}\"/>\n\t\t<Input id=\"deviceDesc\" value=\"{description}\" width=\"100%\"/>\n\t\t<Label text=\"{i18n>transportName}\"/>\n\t\t<Select enabled=\"{global>/edit}\" id=\"deviceTrans\" items=\"{/Transports}\" selectedKey=\"{transport}\" width=\"100%\">\n\t\t\t<core:Item key=\"{id}\" text=\"{description}\"/>\n\t\t</Select>\n\t</form:SimpleForm>\n</core:FragmentDefinition>",
		"diploma/admin/organization/view/DetailFormDisplay.fragment.xml": "<core:FragmentDefinition \n    xmlns:core=\"sap.ui.core\" \n    xmlns:form=\"sap.ui.layout.form\"\n    xmlns=\"sap.m\">\n\t<form:SimpleForm layout=\"ResponsiveGridLayout\" \n\t\tmaxContainerCols=\"2\"\n\t\ttitle=\"{i18n>detailIconTabBarInfo}\" \n\t\tlabelSpanL=\"3\"  labelSpanM=\"3\" \n\t\temptySpanL=\"2\"  emptySpanM=\"2\" \n\t\tcolumnsL=\"1\"    columnsM=\"1\"\n\t\tvisible=\"{= !${global>/edit} }\">\n\t    \n\t\t<Label text=\"{i18n>deviceName}\"/>\n\t\t<Text text=\"{name}\"/>\n\t\t    \n\t\t<Label text=\"{i18n>deviceDesc}\"/>\n\t\t<Text text=\"{description}\" />\n\t\t    \n\t    <Label text=\"{i18n>transportName}\"/>\n\t    <Link text=\"{Transport/description}\" press=\"navigateToTransport\"/>\n\t        \n\t\t<Label text=\"{i18n>transWhen}\" />\n\t\t<Text text=\"{\n    \t        path: 'Transport/tWhen', \n    \t        type: 'sap.ui.model.type.DateTime',\n    \t        format: {style: 'short'}\n    \t    }\"/>\n\t\t    \n\t\t<Label text=\"{i18n>transFrom}\" />\n\t\t<Text text=\"{Transport/Route/FromLocation/name}\"/>\n\t\t    \n\t\t<Label text=\"{i18n>transTo}\" />\n\t\t<Text text=\"{Transport/Route/ToLocation/name}\"/>\n\t</form:SimpleForm>\n</core:FragmentDefinition>",
		"diploma/admin/organization/view/DetailNoObjectsAvailable.view.xml": "<mvc:View controllerName=\"diploma.admin.organization.controller.BaseController\" xmlns:mvc=\"sap.ui.core.mvc\" xmlns=\"sap.m\">\n\t<MessagePage description=\"\" icon=\"{sap-icon://product}\" id=\"page\" navButtonPress=\"onNavBack\" showNavButton=\"{device>/system/phone}\"\n\t\ttext=\"{i18n>noObjectsAvailableText}\" title=\"{i18n>notAvailableViewTitle}\"></MessagePage>\n</mvc:View>",
