		"diploma/admin/organization/view/ViewSettingsDialog.fragment.xml": "<core:FragmentDefinition xmlns:core=\"sap.ui.core\" xmlns=\"sap.m\">\n\t<ViewSettingsDialog confirm=\"onConfirmViewSettingsDialog\" id=\"viewSettingsDialog\" resetFilters=\"onViewSettingsDialogResetFilters\">\n\t\t<filterItems>\n\t\t\t<ViewSettingsFilterItem id=\"filterItems\" key=\"Price\" multiSelect=\"false\" text=\"{i18n>masterFilterName}\">\n\t\t\t\t<items>\n\t\t\t\t\t<ViewSettingsItem id=\"viewFilter1\" key=\"Filter1\" text=\"{i18n>masterFilter1}\"/>\n\t\t\t\t\t<ViewSettingsItem id=\"viewFilter2\" key=\"Filter2\" text=\"{i18n>masterFilter2}\"/>\n\t\t\t\t</items>\n\t\t\t</ViewSettingsFilterItem>\n\t\t</filterItems>\n\t</ViewSettingsDialog>\n</core:FragmentDefinition>",
		"diploma/admin/organization/view/RoleDialog.fragment.xml": "<core:FragmentDefinition \n    xmlns:core=\"sap.ui.core\" \n    xmlns=\"sap.m\">\n\t<Dialog id=\"dlgRole\" \n\t    stretch=\"{device>/system/phone}\"\n\t    contentWidth=\"20rem\"\n\t    contentHeight=\"75%\"\n\t    title=\"{i18n>dlgRoleTitle}\" \n\t    type=\"Standard\">\n\t\t<content>\n\t\t\t<Panel>\n\t\t\t\t<VBox>\n\t\t\t\t    <Label text=\"{i18n>roleName}\"/>\n\t\t\t\t    <Input id=\"inpRoleName\" width=\"100%\"/>\n\t\t\t\t    <Label text=\"{i18n>roleContact}\"/>\n\t\t\t\t    <Select id=\"selRoleContact\" width=\"100%\">\n\t\t\t\t        <core:Item key=\"0\" text=\"{i18n>roleContactOff}\"/>\n\t\t\t\t        <core:Item key=\"1\" text=\"{i18n>roleContactOn}\"/>\n\t\t\t\t    </Select>\n\t\t\t\t    <Button width=\"5rem\" text=\"{i18n>addNewRole}\" type=\"Accept\" press=\"onAddRole\"/>\n\t\t\t\t</VBox>\n\t\t\t\t<Table id=\"lstRoles\" \n\t\t\t\t    mode=\"Delete\"\n\t\t\t\t    delete=\"onDeleteRole\"\n\t\t\t\t    items=\"{path: '/Roles', sorter: {path: 'name'}}\">\n\t\t\t\t    <headerToolbar>\n\t\t\t\t        <Toolbar>\n\t\t\t\t            <Title text=\"{i18n>roleListHeader}\"/>\n\t\t\t\t            <ToolbarSpacer/>\n\t\t\t\t            <SearchField search=\"onRoleSearch\" width=\"13rem\"/>\n\t\t\t\t        </Toolbar>\n\t\t\t\t    </headerToolbar>\n\t\t\t\t    <columns>\n\t\t\t\t        <Column><Label text=\"{i18n>roleNameColumn}\"/></Column>\n\t\t\t\t        <Column><Label text=\"{i18n>roleContactColumn}\"/></Column>\n\t\t\t\t    </columns>\n\t\t\t\t    <ColumnListItem>\n\t\t\t\t        <Text text=\"{name}\"/>\n\t\t\t\t        <ObjectStatus \n\t\t\t\t            state=\"{= ${contact} === 1 ? 'Success' : 'Error' }\"\n\t\t\t\t            text=\"{= ${contact} === 1 ? ${i18n>roleContactOn} : ${i18n>roleContactOff} }\"/>\n\t\t\t\t    </ColumnListItem>\n\t\t\t\t</Table>\n\t\t\t</Panel>\n\t\t</content>\n\t\t<endButton><Button text=\"{i18n>close}\" press=\"onCloseRoleDialog\"/></endButton>\n\t</Dialog>\n</core:FragmentDefinition>"
